import React from 'react';
import './App.css';


const App = () => {
  return (
    <div className='app_wrapper'>
      <header classNaam ='header'>
        <div ckassName='header__logo'>
        <img src="https://encrypted-tbn0.gstatic.com/images?q=tbn:ANd9GcSsuruOSLEm-uiaXsnIXl5iQVQxvjXiZKfuDA&usqp=CAU" />
        </div>
      </header>
      <nav className='nav'>
        <div>Profile</div>
        <div>Messages</div>
        <div>News</div>
        <div>Music</div>
      </nav>
      <div className='content'>
        Main content
      </div>
    </div>
  );
}

export default App;
